    "2016-03-17T20:51:48.308161",nt"name": "economic-development-projects-under-contract",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset includes information on economic
    development projects that have been awarded incentives through Iowa Economic Development
    Authority programs as early as FY 2003, have signed contracts with the state and
    are in either the u201cperformanceu201d period, the u201cmaintenanceu201d period
    or are "in default" as of the end of the fiscal year noted. In most cases, projects
    are required to have met job, wage and capital investment obligations by their u201cProject
    Completion Dateu201d. Beyond the completion date, projects are required to maintain
    the obligated jobs and investment through the u201cMaintenance Date."  All projects
    provide information on total project costs, capital investment, as well as the amount
    of direct assistance and tax credits awarded to the project.  Projected and contracted
    job data is available for all projects.  However, project completion jobs and reported
    jobs is only available for those projects in the "maintenance" period.  Projects
    in the "performance" period are still in the process of being implemented and
    are not yet complete.  Projects in Default were considered u201cin defaultu201d
    as of the end of the annual report cut-off date (typically end of fiscal year).
     The status u201cin defaultu201d is a temporary one since businesses are allowed
    a contractually designated cure period to correct the default. Reasons for being
    considered u201cin defaultu201d range from not filing required reports to not creating
    the obligated jobs or investment required by the contract.",nt"license_title":
